import React from "react";
import QuoteList from "../components/quotes/QuoteList";

const DUMMY_DATA = [
  { id: "q1", author: "abc", text: "abc" },
  { id: "q2", author: "def", text: "def" },
];

export default function AllQuotes() {
  return <QuoteList quotes={DUMMY_DATA} />;
}
